  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:53.753615\",\n\t\"name\": \"environmental-contaminants-in-tern-eggs-from-monomoy-national-wildlife-refuge-and-seal-isl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the 2005 breeding season, six non-viable
  common tern (Sterna hirundo) and three roseate tern (Sterna dougallii) eggs were
  collected from Monomoy National Wildlife Refuge in Massachusetts and Seal Island
  NWR in Maine. Eggs were formed into three 3-egg species specific composites u2013
  one common tern sample and one roseate tern sample from Monomoy NWR, and one common
  tern sample from Seal Island NWR. All composite samples were analyzed for 26 organochlorine
  compounds and 19 trace elements. At Monomoy NWR, Total Polychlorinated Biphenyl
  (PCB) concentrations in common tern and roseate tern composite egg samples were
  0.67 and 1.13 parts-per-million (ppm), fresh wet weight, respectively. Total PCB
  in the common tern composite egg sample from Seal Island NWR was 0.34 ppm. DDE,
  a metabolite of the pesticide DDT, was found at 0.03 ppm in both the common and
  roseate tern samples from Monomoy NWR, and at 0.05 ppm in the common tern sample
  from Seal Island NWR. Concentrations of Total PCB and DDE were below suggested toxic
  effect threshold levels. Twenty-four other organochlorine compounds were below detection
  limits or in the low parts-per-billion (ppb) range.\",\n\t\"license_title\": \"License
